import React, { useState } from 'react';
import { Link, Element, animateScroll as scroll } from 'react-scroll'; // Import from react-scroll
import { RiMenu3Line, RiCloseLine } from 'react-icons/ri';
import logo from '../../assets/logo.png';
import './navbar.css';

const Navbar = () => {
    const [toggleMenu, setToggleMenu] = useState(false);

    const closeMenu = () => {
        setToggleMenu(false);
    };

    return (
        <div className="fa__navbar">
            <div className="fa__navbar-links">
                <div className="fa__navbar-links_logo">
                    <img src={logo} alt="Logo" />
                </div>
                <div className="fa__navbar-links_container">
                    <p>
                        <Link
                            to="home"
                            smooth={true}
                            duration={500}
                            onClick={closeMenu}
                        >
                            Home
                        </Link>
                    </p>
                    <p>
                        <Link
                            to="product"
                            smooth={true}
                            duration={500}
                            onClick={closeMenu}
                        >
                            Product
                        </Link>
                    </p>
                    <p>
                        <Link
                            to="faq"
                            smooth={true}
                            duration={500}
                            onClick={closeMenu}
                        >
                            FAQ
                        </Link>
                    </p>
                    <p>
                        <Link
                            to="contact"
                            smooth={true}
                            duration={500}
                            onClick={closeMenu}
                        >
                            Contact
                        </Link>
                    </p>
                </div>
            </div>
            <div className="fa__navbar-menu">
                {toggleMenu ? (
                    <RiCloseLine
                        color="#252B42"
                        size={25}
                        onClick={() => setToggleMenu(false)}
                    />
                ) : (
                    <RiMenu3Line
                        color="#252B42"
                        size={25}
                        onClick={() => setToggleMenu(true)}
                    />
                )}
                {toggleMenu && (
                    <div className="fa__navbar-menu_container scale-up-center">
                        <div className="fa__navbar-menu_container-links">
                            <p>
                                <Link
                                    to="home"
                                    smooth={true}
                                    duration={500}
                                    onClick={closeMenu}
                                >
                                    Home
                                </Link>
                            </p>
                            <p>
                                <Link
                                    to="product"
                                    smooth={true}
                                    duration={500}
                                    onClick={closeMenu}
                                >
                                    Product
                                </Link>
                            </p>
                            <p>
                                <Link
                                    to="faq"
                                    smooth={true}
                                    duration={500}
                                    onClick={closeMenu}
                                >
                                    FAQ
                                </Link>
                            </p>
                            <p>
                                <Link
                                    to="contact"
                                    smooth={true}
                                    duration={500}
                                    onClick={closeMenu}
                                >
                                    Contact
                                </Link>
                            </p>
                        </div>
                    </div>
                )}
            </div>
            <Element name="home"> {/* Add Element components for each section */}
                <section className="section" id="home">
                    <h2>Home</h2>
                    {/* Content of the Home section */}
                </section>
            </Element>
            <Element name="product">
                <section className="section" id="product">
                    <h2>Product</h2>
                    {/* Content of the Product section */}
                </section>
            </Element>
            <Element name="faq">
                <section className="section" id="faq">
                    <h2>FAQ</h2>
                    {/* Content of the FAQ section */}
                </section>
            </Element>
            <Element name="contact">
                <section className="section" id="contact">
                    <h2>Contact</h2>
                    {/* Content of the Contact section */}
                </section>
            </Element>
        </div>
    );
};

export default Navbar;
